  {id:"menu_sort_0", sort_cat:"Simple Sort"},
  {id:"menu_sort_0", sort_cat:"Simple Sort"},
  {id:"menu_sort_0", sort_cat:"Simple Sort"},
  {id:"menu_sort_0", sort_cat:"Simple Sort"},
]

ReactDOM.render(
  <React.StrictMode>
    <App menus={SORT_MENUS}/>
